import '../styles/ContactForm.css';
const ContactForm = () => {
    return (
       <>
       <br/>
         <div className="contact-form-container">
             <p><b>Name</b> (required)</p>
                <input className="contact-input-bar" type="text" placeholder="Enter your name" />
                <p><b>Email</b> (required)</p>
                <input className="contact-input-bar" type="text" placeholder="Enter your email" />

         </div>
       </>
    );
}

export default ContactForm;
